    // word because each write operation emits an extra SLOAD to first read the
    // slot's contents, replace the bits taken up by the boolean, and then write
    // back. This is the compiler's defense against contract upgrades and
    // pointer aliasing, and it cannot be disabled.

    // The values being non-zero value makes deployment a bit more expensive,
    // but in exchange the refund on every call to nonReentrant will be lower in
    // amount. Since refunds are capped to a percentage of the total
    // transaction's gas, it is best to keep them low in cases like this one, to
    // increase the likelihood of the full refund coming into effect.
    uint256 private constant NOT_ENTERED = 1;
    uint256 private constant ENTERED = 2;

    uint256 private _status;

    /**
     * @dev Unauthorized reentrant call.
     */
    error ReentrancyGuardReentrantCall();

    constructor() {
        _status = NOT_ENTERED;
    }

    /**
     * @dev Prevents a contract from calling itself, directly or indirectly.
     * Calling a `nonReentrant` function from another `nonReentrant`
     * function is not supported. It is possible to prevent this from happening
     * by making the `nonReentrant` function external, and making it call a
     * `private` function that does the actual work.
     */
    modifier nonReentrant() {
        _nonReentrantBefore();
        _;
        _nonReentrantAfter();
    }

    function _nonReentrantBefore() private {
        // On the first call to nonReentrant, _status will be NOT_ENTERED
        if (_status == ENTERED) {
            revert ReentrancyGuardReentrantCall();
        }

        // Any calls to nonReentrant after this point will fail
        _status = ENTERED;
    }

    function _nonReentrantAfter() private {
        // By storing the original value once again, a refund is triggered (see
        // https://eips.ethereum.org/EIPS/eip-2200)
        _status = NOT_ENTERED;
    }

    /**
     * @dev Returns true if the reentrancy guard is currently set to "entered", which indicates there is a
     * `nonReentrant` function in the call stack.
     */
    function _reentrancyGuardEntered() internal view returns (bool) {
        return _status == ENTERED;
    }
}

contracts/TubeDataPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./TubeToken.sol";

/**
 * @title TubeDataPool
 * @dev Data Liquidity Pool for TubeDAO - manages data contributions and validation
 * Integrates with Vana's DataRegistry and TEE Pool infrastructure
 */
contract TubeDataPool is Ownable, ReentrancyGuard {
    TubeToken public immutable tubeToken;

    address public dataRegistry;
    address public teePool;

    struct DataContribution {
        address contributor;
        string dataType;
        bytes32 dataHash;
        uint256 timestamp;
        uint256 qualityScore;
        bool validated;
        bool rewarded;
        string ipfsHash;
    }

    struct ProofOfContribution {
        bytes32 contributionHash;
        bytes signature;
        uint256 nonce;
        uint256 timestamp;
    }

    mapping(bytes32 => DataContribution) public contributions;
    mapping(address => bytes32[]) public contributorHistory;
    mapping(address => uint256) public contributorNonce;

    event DataSubmitted(address indexed contributor, bytes32 indexed contributionHash, string dataType);
    event DataValidated(bytes32 indexed contributionHash, uint256 qualityScore);
    event DataRewarded(address indexed contributor, bytes32 indexed contributionHash, uint256 tokens);
    event VanaIntegrationUpdated(address dataRegistry, address teePool);

    constructor(address _tubeToken) Ownable(msg.sender) {
        require(_tubeToken != address(0), "Invalid token address");
        tubeToken = TubeToken(_tubeToken);
    }

    /**
     * @dev Submit data contribution with proof
     */
    function submitDataContribution(
        string memory dataType,
        bytes32 dataHash,
        string memory ipfsHash,
        bytes memory signature
    ) external nonReentrant {
        require(bytes(dataType).length > 0, "Invalid data type");
        require(dataHash != bytes32(0), "Invalid data hash");

        bytes32 contributionHash = keccak256(
            abi.encodePacked(
                msg.sender,
                dataType,
                dataHash,
                contributorNonce[msg.sender]++
            )
        );

        require(signature.length > 0, "Invalid signature");

        contributions[contributionHash] = DataContribution({
            contributor: msg.sender,
            dataType: dataType,
            dataHash: dataHash,
            timestamp: block.timestamp,
            qualityScore: 0,
            validated: false,
            rewarded: false,
            ipfsHash: ipfsHash
        });

        contributorHistory[msg.sender].push(contributionHash);

        emit DataSubmitted(msg.sender, contributionHash, dataType);
    }

    /**
     * @dev Validate data contribution (called by TEE or validator)
     */
    function validateContribution(
        bytes32 contributionHash,
        uint256 qualityScore
    ) external onlyOwner {
        DataContribution storage contribution = contributions[contributionHash];
        require(contribution.contributor != address(0), "Contribution not found");
        require(!contribution.validated, "Already validated");
        require(qualityScore <= 10, "Invalid quality score");

        contribution.qualityScore = qualityScore;
        contribution.validated = true;

        emit DataValidated(contributionHash, qualityScore);

        if (qualityScore > 0) {
            _rewardContribution(contributionHash);
        }
    }

    /**
     * @dev Internal function to reward validated contributions
     */
    function _rewardContribution(bytes32 contributionHash) internal {
        DataContribution storage contribution = contributions[contributionHash];
        require(contribution.validated, "Not validated");
        require(!contribution.rewarded, "Already rewarded");

        contribution.rewarded = true;

        string memory dataType = contribution.dataType;
        uint256 qualityScore = contribution.qualityScore;

        if (keccak256(bytes(dataType)) == keccak256(bytes("premium"))) {
            qualityScore = (qualityScore * 15) / 10; // 50% bonus
            if (qualityScore > 10) qualityScore = 10;
        }

        tubeToken.mintForContribution(
            contribution.contributor,
            contributionHash,
            qualityScore,
            dataType
        );

        emit DataRewarded(contribution.contributor, contributionHash, qualityScore * 100 * 10**18);
    }

    /**
     * @dev Set Vana integration addresses (only owner)
     */
    function setVanaIntegration(address _dataRegistry, address _teePool) external onlyOwner {
        dataRegistry = _dataRegistry;
        teePool = _teePool;
        emit VanaIntegrationUpdated(_dataRegistry, _teePool);
    }

    /**
     * @dev Get contribution details
     */
    function getContribution(bytes32 contributionHash) external view returns (DataContribution memory) {
        return contributions[contributionHash];
    }

    /**
     * @dev Get contributor's contribution history
     */
    function getContributorHistory(address contributor) external view returns (bytes32[] memory) {
        return contributorHistory[contributor];
    }

    /**
     * @dev Calculate contribution hash (for verification)
     */
    function calculateContributionHash(
        address contributor,
        string memory dataType,
        bytes32 dataHash,
        uint256 nonce
    ) external pure returns (bytes32) {
        return keccak256(abi.encodePacked(contributor, dataType, dataHash, nonce));
    }
}

contracts/TubeGovernance.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./TubeToken.sol";

/**
 * @title TubeGovernance
 * @dev DAO governance contract for TubeDAO
 * Implements voting mechanisms for data licensing and platform decisions
 */
contract TubeGovernance is Ownable, ReentrancyGuard {
    TubeToken public immutable tubeToken;

    enum ProposalType {
        DATA_LICENSING,
        PARAMETER_CHANGE,
        TREASURY_ALLOCATION,
        CREATOR_INSIGHTS
    }

    enum ProposalStatus {
        PENDING,
        ACTIVE,
        PASSED,
        REJECTED,
        EXECUTED,
        CANCELLED
    }

    struct Proposal {
        uint256 id;
        address proposer;
        ProposalType proposalType;
        string title;
        string description;
        string ipfsHash;
        uint256 startTime;
        uint256 endTime;
        uint256 forVotes;
        uint256 againstVotes;
        uint256 abstainVotes;
        ProposalStatus status;
        bool executed;
        bytes executionData;
    }

    struct Vote {
        bool hasVoted;
        uint8 support;
        uint256 weight;
    }

    uint256 public proposalCounter;
    uint256 public constant VOTING_PERIOD = 3 days;
    uint256 public constant VOTING_DELAY = 1 days;
    uint256 public constant PROPOSAL_THRESHOLD = 10000 * 10**18; // 10,000 tokens to propose
    uint256 public constant QUORUM_PERCENTAGE = 4; // 4% of total supply

    mapping(uint256 => Proposal) public proposals;
    mapping(uint256 => mapping(address => Vote)) public votes;
    mapping(address => uint256) public latestProposalIds;

    event ProposalCreated(
        uint256 indexed proposalId,
        address indexed proposer,
        ProposalType proposalType,
        string title,
        uint256 startTime,
        uint256 endTime
    );

    event VoteCast(
        address indexed voter,
        uint256 indexed proposalId,
        uint8 support,
        uint256 weight
    );

    event ProposalExecuted(uint256 indexed proposalId);
    event ProposalCancelled(uint256 indexed proposalId);

    modifier onlyTokenHolder() {
        require(tubeToken.balanceOf(msg.sender) > 0, "Must hold TUBE tokens");
        _;
    }

    constructor(address _tubeToken) Ownable(msg.sender) {
        require(_tubeToken != address(0), "Invalid token address");
        tubeToken = TubeToken(_tubeToken);
    }

    /**
     * @dev Create a new proposal
     */
    function propose(
        ProposalType proposalType,
        string memory title,
        string memory description,
        string memory ipfsHash,
        bytes memory executionData
    ) external onlyTokenHolder nonReentrant returns (uint256) {
        require(tubeToken.balanceOf(msg.sender) >= PROPOSAL_THRESHOLD, "Below proposal threshold");
        require(bytes(title).length > 0, "Title required");
        require(bytes(description).length > 0, "Description required");

        if (latestProposalIds[msg.sender] != 0) {
            ProposalStatus status = proposals[latestProposalIds[msg.sender]].status;
            require(
                status != ProposalStatus.PENDING && status != ProposalStatus.ACTIVE,
                "Already has active proposal"
            );
        }

        uint256 proposalId = ++proposalCounter;
        uint256 startTime = block.timestamp + VOTING_DELAY;
        uint256 endTime = startTime + VOTING_PERIOD;

        proposals[proposalId] = Proposal({
            id: proposalId,
            proposer: msg.sender,
            proposalType: proposalType,
            title: title,
            description: description,
            ipfsHash: ipfsHash,
            startTime: startTime,
            endTime: endTime,
            forVotes: 0,
            againstVotes: 0,
            abstainVotes: 0,
            status: ProposalStatus.PENDING,
            executed: false,
            executionData: executionData
        });

        latestProposalIds[msg.sender] = proposalId;

        emit ProposalCreated(
            proposalId,
            msg.sender,
            proposalType,
            title,
            startTime,
            endTime
        );

        return proposalId;
    }

    /**
     * @dev Cast vote on a proposal
     */
    function castVote(uint256 proposalId, uint8 support) external onlyTokenHolder nonReentrant {
        require(support <= 2, "Invalid vote type");
        Proposal storage proposal = proposals[proposalId];
        require(proposal.id != 0, "Proposal not found");

        _updateProposalStatus(proposalId);

        require(proposal.status == ProposalStatus.ACTIVE, "Voting not active");
        require(!votes[proposalId][msg.sender].hasVoted, "Already voted");

        uint256 weight = tubeToken.balanceOf(msg.sender);
        require(weight > 0, "No voting power");

        votes[proposalId][msg.sender] = Vote({
            hasVoted: true,
            support: support,
            weight: weight
        });

        if (support == 0) {
            proposal.againstVotes += weight;
        } else if (support == 1) {
            proposal.forVotes += weight;
        } else {
            proposal.abstainVotes += weight;
        }

        emit VoteCast(msg.sender, proposalId, support, weight);
    }

    /**
     * @dev Execute a passed proposal
     */
    function execute(uint256 proposalId) external nonReentrant {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.id != 0, "Proposal not found");

        _updateProposalStatus(proposalId);

        require(proposal.status == ProposalStatus.PASSED, "Proposal not passed");
        require(!proposal.executed, "Already executed");

        proposal.executed = true;
        proposal.status = ProposalStatus.EXECUTED;

        if (proposal.proposalType == ProposalType.DATA_LICENSING) {
            _executeDataLicensing(proposal.executionData);
        } else if (proposal.proposalType == ProposalType.PARAMETER_CHANGE) {
            _executeParameterChange(proposal.executionData);
        } else if (proposal.proposalType == ProposalType.TREASURY_ALLOCATION) {
            _executeTreasuryAllocation(proposal.executionData);
        } else if (proposal.proposalType == ProposalType.CREATOR_INSIGHTS) {
            _executeCreatorInsights(proposal.executionData);
        }

        emit ProposalExecuted(proposalId);
    }

    /**
     * @dev Cancel a proposal (only proposer or owner)
     */
    function cancel(uint256 proposalId) external {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.id != 0, "Proposal not found");
        require(
            msg.sender == proposal.proposer || msg.sender == owner(),
            "Not authorized"
        );
        require(
            proposal.status == ProposalStatus.PENDING || proposal.status == ProposalStatus.ACTIVE,
            "Cannot cancel"
        );

        proposal.status = ProposalStatus.CANCELLED;
        emit ProposalCancelled(proposalId);
    }

    /**
     * @dev Update proposal status based on time and votes
     */
    function _updateProposalStatus(uint256 proposalId) internal {
        Proposal storage proposal = proposals[proposalId];

        if (proposal.status == ProposalStatus.PENDING && block.timestamp >= proposal.startTime) {
            proposal.status = ProposalStatus.ACTIVE;
        }

        if (proposal.status == ProposalStatus.ACTIVE && block.timestamp > proposal.endTime) {
            uint256 totalVotes = proposal.forVotes + proposal.againstVotes;
            uint256 quorum = (tubeToken.totalSupply() * QUORUM_PERCENTAGE) / 100;

            if (totalVotes >= quorum && proposal.forVotes > proposal.againstVotes) {
                proposal.status = ProposalStatus.PASSED;
            } else {
                proposal.status = ProposalStatus.REJECTED;
            }
        }
    }

    /**
     * @dev Execute data licensing proposal
     */
    function _executeDataLicensing(bytes memory data) internal {
        // Implementation for data licensing execution
        // This would interact with DataPool contract
    }

    /**
     * @dev Execute parameter change proposal
     */
    function _executeParameterChange(bytes memory data) internal {
        // Implementation for parameter changes
    }

    /**
     * @dev Execute treasury allocation proposal
     */
    function _executeTreasuryAllocation(bytes memory data) internal {
        // Implementation for treasury allocation
    }

    /**
     * @dev Execute creator insights proposal
     */
    function _executeCreatorInsights(bytes memory data) internal {
        // Implementation for creator insights access
    }

    /**
     * @dev Get proposal details
     */
    function getProposal(uint256 proposalId) external view returns (Proposal memory) {
        return proposals[proposalId];
    }

    /**
     * @dev Get vote details
     */
    function getVote(uint256 proposalId, address voter) external view returns (Vote memory) {
        return votes[proposalId][voter];
    }

    /**
     * @dev Check if proposal reached quorum
     */
    function hasReachedQuorum(uint256 proposalId) external view returns (bool) {
        Proposal memory proposal = proposals[proposalId];
        uint256 totalVotes = proposal.forVotes + proposal.againstVotes;
        uint256 quorum = (tubeToken.totalSupply() * QUORUM_PERCENTAGE) / 100;
        return totalVotes >= quorum;
    }
}

contracts/TubeTEEIntegration.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title TubeTEEIntegration
 * @dev TEE (Trusted Execution Environment) integration for privacy-preserving data processing
 * Implements Vana's TEE Pool interface for secure data validation
 */
contract TubeTEEIntegration is Ownable, ReentrancyGuard {
    struct TEENode {
        address nodeAddress;
        string endpoint;
        bool isActive;
        uint256 stake;
        uint256 reputation;
        uint256 jobsCompleted;
    }

    struct ValidationJob {
        bytes32 jobId;
        address requester;
        bytes32 dataHash;
        string dataType;
        uint256 timestamp;
        bool completed;
        uint256 qualityScore;
        address assignedNode;
    }

    address public dataPoolAddress;
    mapping(address => TEENode) public teeNodes;
    mapping(bytes32 => ValidationJob) public validationJobs;
    mapping(address => bytes32[]) public nodeJobs;

    address[] public activeNodes;
    uint256 public minStakeRequired = 1000 * 10**18; // 1000 tokens minimum stake
    uint256 public jobCounter;

    event TEENodeRegistered(address indexed node, string endpoint, uint256 stake);
    event TEENodeDeactivated(address indexed node);
    event ValidationJobCreated(bytes32 indexed jobId, address requester, bytes32 dataHash);
    event ValidationCompleted(bytes32 indexed jobId, uint256 qualityScore, address node);
    event DataAttested(bytes32 indexed dataHash, address attester, uint256 timestamp);

    modifier onlyDataPool() {
        require(msg.sender == dataPoolAddress, "Only DataPool can call");
        _;
    }

    modifier onlyActiveTEE() {
        require(teeNodes[msg.sender].isActive, "Not an active TEE node");
        _;
    }

    constructor(address _dataPoolAddress) Ownable(msg.sender) {
        require(_dataPoolAddress != address(0), "Invalid DataPool address");
        dataPoolAddress = _dataPoolAddress;
    }

    /**
     * @dev Register as a TEE node
     */
    function registerTEENode(string memory endpoint) external payable nonReentrant {
        require(msg.value >= minStakeRequired, "Insufficient stake");
        require(bytes(endpoint).length > 0, "Invalid endpoint");
        require(!teeNodes[msg.sender].isActive, "Node already registered");

        teeNodes[msg.sender] = TEENode({
            nodeAddress: msg.sender,
            endpoint: endpoint,
            isActive: true,
            stake: msg.value,
            reputation: 100,
            jobsCompleted: 0
        });

        activeNodes.push(msg.sender);
        emit TEENodeRegistered(msg.sender, endpoint, msg.value);
    }

    /**
     * @dev Create validation job for data contribution
     */
    function createValidationJob(
        bytes32 dataHash,
        string memory dataType
    ) external onlyDataPool returns (bytes32) {
        bytes32 jobId = keccak256(abi.encodePacked(dataHash, jobCounter++, block.timestamp));

        // Select TEE node (round-robin for simplicity, use reputation-based in production)
        address selectedNode = selectTEENode();
        require(selectedNode != address(0), "No available TEE nodes");

        validationJobs[jobId] = ValidationJob({
            jobId: jobId,
            requester: msg.sender,
            dataHash: dataHash,
            dataType: dataType,
            timestamp: block.timestamp,
            completed: false,
            qualityScore: 0,
            assignedNode: selectedNode
        });

        nodeJobs[selectedNode].push(jobId);
        emit ValidationJobCreated(jobId, msg.sender, dataHash);

        return jobId;
    }

    /**
     * @dev Submit validation result (called by TEE node)
     */
    function submitValidationResult(
        bytes32 jobId,
        uint256 qualityScore,
        bytes memory proof
    ) external onlyActiveTEE nonReentrant {
        ValidationJob storage job = validationJobs[jobId];
        require(job.assignedNode == msg.sender, "Not assigned to this node");
        require(!job.completed, "Job already completed");
        require(qualityScore <= 10, "Invalid quality score");
        require(proof.length > 0, "Invalid proof");

        job.completed = true;
        job.qualityScore = qualityScore;

        TEENode storage node = teeNodes[msg.sender];
        node.jobsCompleted++;
        if (qualityScore >= 7) {
            node.reputation += 1;
        }

        emit ValidationCompleted(jobId, qualityScore, msg.sender);

    }

    /**
     * @dev Attest data integrity (for Vana DataRegistry integration)
     */
    function attestData(
        bytes32 dataHash,
        bytes memory signature
    ) external onlyActiveTEE {
        require(signature.length > 0, "Invalid signature");

        emit DataAttested(dataHash, msg.sender, block.timestamp);
    }

    /**
     * @dev Select TEE node for job assignment
     */
    function selectTEENode() internal view returns (address) {
        if (activeNodes.length == 0) return address(0);

        uint256 index = jobCounter % activeNodes.length;
        address selected = activeNodes[index];

        if (teeNodes[selected].isActive) {
            return selected;
        }

        for (uint256 i = 0; i < activeNodes.length; i++) {
            if (teeNodes[activeNodes[i]].isActive) {
                return activeNodes[i];
            }
        }

        return address(0);
    }

    /**
     * @dev Deactivate TEE node
     */
    function deactivateTEENode() external onlyActiveTEE {
        TEENode storage node = teeNodes[msg.sender];
        node.isActive = false;

        for (uint256 i = 0; i < activeNodes.length; i++) {
            if (activeNodes[i] == msg.sender) {
                activeNodes[i] = activeNodes[activeNodes.length - 1];
                activeNodes.pop();
                break;
            }
        }

        if (node.stake > 0) {
            uint256 stakeToReturn = node.stake;
            node.stake = 0;
            payable(msg.sender).transfer(stakeToReturn);
        }

        emit TEENodeDeactivated(msg.sender);
    }

    /**
     * @dev Update minimum stake requirement (owner only)
     */
    function updateMinStake(uint256 newMinStake) external onlyOwner {
        minStakeRequired = newMinStake;
    }

    /**
     * @dev Get active TEE nodes count
     */
    function getActiveNodeCount() external view returns (uint256) {
        return activeNodes.length;
    }

    /**
     * @dev Get job details
     */
    function getJob(bytes32 jobId) external view returns (ValidationJob memory) {
        return validationJobs[jobId];
    }

    /**
     * @dev Get node's assigned jobs
     */
    function getNodeJobs(address node) external view returns (bytes32[] memory) {
        return nodeJobs[node];
    }
}

contracts/TubeToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title TubeToken
 * @dev VRC-20 compliant data token for TubeDAO on Vana Network
 * Implements proof-of-contribution based minting for YouTube data contributors
 */
contract TubeToken is ERC20, ERC20Burnable, Ownable, ReentrancyGuard {
    uint256 public constant MAX_SUPPLY = 1_000_000_000 * 10**18;
    uint256 public constant INITIAL_MINT = 100_000_000 * 10**18;

    uint256 public baseRewardPerContribution = 100 * 10**18;
    uint256 public qualityMultiplier = 10;

    mapping(address => bool) public validators;
    mapping(address => uint256) public contributorScores;
    mapping(bytes32 => bool) public processedContributions;
    mapping(address => uint256) public lastContributionTime;

    event ContributionValidated(address indexed contributor, bytes32 contributionHash, uint256 score);
    event RewardMinted(address indexed contributor, uint256 amount, string dataType);
    event ValidatorAdded(address indexed validator);
    event ValidatorRemoved(address indexed validator);
    event QualityScoreUpdated(address indexed contributor, uint256 newScore);

    modifier onlyValidator() {
        require(validators[msg.sender], "TubeToken: caller is not a validator");
        _;
    }

    modifier contributionNotProcessed(bytes32 _contributionHash) {
        require(!processedContributions[_contributionHash], "TubeToken: contribution already processed");
        _;
    }

    constructor() ERC20("TubeDAO Token", "TUBE") Ownable(msg.sender) {
        _mint(msg.sender, INITIAL_MINT);
        validators[msg.sender] = true;
        emit ValidatorAdded(msg.sender);
    }

    /**
     * @dev Mint tokens based on proof of contribution
     * @param contributor Address of the data contributor
     * @param contributionHash Unique hash of the contribution
     * @param qualityScore Quality score (0-10) of the contribution
     * @param dataType Type of YouTube data contributed
     */
    function mintForContribution(
        address contributor,
        bytes32 contributionHash,
        uint256 qualityScore,
        string memory dataType
    ) external onlyValidator contributionNotProcessed(contributionHash) nonReentrant {
        require(contributor != address(0), "TubeToken: invalid contributor");
        require(qualityScore <= qualityMultiplier, "TubeToken: quality score too high");
        require(totalSupply() < MAX_SUPPLY, "TubeToken: max supply reached");

        processedContributions[contributionHash] = true;

        uint256 reward = (baseRewardPerContribution * qualityScore) / qualityMultiplier;

        uint256 timeSinceLastContribution = block.timestamp - lastContributionTime[contributor];
        if (timeSinceLastContribution < 1 days) {
            reward = (reward * 110) / 100; // 10% bonus for daily contributors
        }

        if (totalSupply() + reward > MAX_SUPPLY) {
            reward = MAX_SUPPLY - totalSupply();
        }

        contributorScores[contributor] += qualityScore;
        lastContributionTime[contributor] = block.timestamp;

        _mint(contributor, reward);

        emit ContributionValidated(contributor, contributionHash, qualityScore);
        emit RewardMinted(contributor, reward, dataType);
        emit QualityScoreUpdated(contributor, contributorScores[contributor]);
    }

    /**
     * @dev Add a new validator (only owner)
     */
    function addValidator(address validator) external onlyOwner {
        require(validator != address(0), "TubeToken: invalid validator");
        require(!validators[validator], "TubeToken: already a validator");
        validators[validator] = true;
        emit ValidatorAdded(validator);
    }

    /**
